/*!

=========================================================
* Light Bootstrap Dashboard React - v2.0.1
=========================================================

* Product Page: https://www.creative-tim.com/product/light-bootstrap-dashboard-react
* Copyright 2022 Creative Tim (https://www.creative-tim.com)
* Licensed under MIT (https://github.com/creativetimofficial/light-bootstrap-dashboard-react/blob/master/LICENSE.md)

* Coded by Creative Tim

=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.

*/
import React, { useState } from "react";
import { Container } from "react-bootstrap";
import styles from "./index.module.css";
import Menu from "@mui/material/Menu";
import { MenuItem } from "@mui/material";
import {
  BackupTable,
  FiberNew,
  Help,
  Home,
  Logout,
  ManageAccounts,
  MoneyOff,
  MoneyRounded,
  Report,
  Summarize,
} from "@mui/icons-material";

const Header = () => {
  const [anchorEl, setAnchorEl] = useState(null);
  const [menu2, setMenu2] = useState(null);
  const [menu3, setMenu3] = useState(null);
  const handleOpenMenu = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleCloseMenu2 = () => {
    setMenu3(null);
  };
  const handleOpenMenu1 = (event) => {
    setMenu2(event.currentTarget);
  };
  const handleCloseMenu = () => {
    setAnchorEl(null);
  };
  const handleCloseMenu1 = () => {
    setMenu2(null);
  };
  return (
    <footer className={styles.footer}>
      <Container fluid>
        <ul className={styles.footermenu}>
          <li className={styles.navigate}>
            <a
              href="#pablo"
              className={styles.iconsbox}
              onClick={(e) => e.preventDefault()}
            >
              <Home
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />{" "}
              <span>Home</span>
            </a>
          </li>
          <li className={styles.navigate}>
            <a
              aria-controls="hover-menu1"
              aria-haspopup="true"
              onMouseEnter={handleOpenMenu}
              href="#pablo"
              onClick={(e) => e.preventDefault()}
              className={styles.iconsbox}
            >
              <ManageAccounts
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />{" "}
              <span>Master</span>
            </a>
          </li>
          <li className={styles.navigate}>
            <a
              aria-controls="hover-menu2"
              aria-haspopup="true"
              onMouseEnter={handleOpenMenu1}
              href="#pablo"
              onClick={(e) => e.preventDefault()}
              className={styles.iconsbox}
            >
              <MoneyOff
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />
              <span>Transaction</span>
            </a>
          </li>
          <li className={styles.navigate}>
            <a
              aria-controls="hover-menu3"
              aria-haspopup="true"
              onMouseEnter={handleOpenMenu}
              href="#pablo"
              onClick={(e) => e.preventDefault()}
              className={styles.iconsbox}
            >
              <FiberNew
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />{" "}
              <span>Namu</span>
            </a>
          </li>
          <li className={styles.navigate}>
            <a
              aria-controls="hover-menu5"
              aria-haspopup="true"
              onMouseEnter={handleOpenMenu}
              href="#pablo"
              className={styles.iconsbox}
              onClick={(e) => e.preventDefault()}
            >
              <Summarize
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />
              <span> Report</span>
            </a>
          </li>
          <li className={styles.navigate}>
            <a
              aria-controls="hover-menu6"
              aria-haspopup="true"
              onMouseEnter={handleOpenMenu}
              href="#pablo"
              className={styles.iconsbox}
              onClick={(e) => e.preventDefault()}
            >
              <BackupTable
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />{" "}
              <span>Utility</span>
            </a>
          </li>
          <li className={styles.navigate}>
            <a
              aria-controls="hover-menu7"
              aria-haspopup="true"
              onMouseEnter={handleOpenMenu}
              href="#pablo"
              onClick={(e) => e.preventDefault()}
              className={styles.iconsbox}
            >
              <Help
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />{" "}
              <spam>Help</spam>
            </a>
          </li>
          <li className={styles.navigate}>
            <a
              aria-controls="hover-menu8"
              aria-haspopup="true"
              onMouseEnter={handleOpenMenu}
              href="#pablo"
              onClick={(e) => e.preventDefault()}
              className={styles.iconsbox}
            >
              <Logout
                style={{ width: "18px", height: "16px", marginRight: "5px" }}
              />{" "}
              <span>Out</span>
            </a>
          </li>
        </ul>
        <Menu
          id="hover-menu1"
          anchorEl={anchorEl}
          keepMounted
          open={Boolean(anchorEl)}
          onClose={handleCloseMenu}
          onMouseLeave={handleCloseMenu}
        >
          <div style={{ display: "flex" }}>
            <div>
              {" "}
              <MenuItem className={styles.hovermenu} onClick={handleCloseMenu}>
                Assembly
              </MenuItem>
              <MenuItem className={styles.hovermenu} onClick={handleCloseMenu}>
                My Community Entry
              </MenuItem>
              <MenuItem className={styles.hovermenu} onClick={handleCloseMenu}>
                Employee Entry
              </MenuItem>
              <MenuItem className={styles.hovermenu} onClick={handleCloseMenu}>
                Dead stock
              </MenuItem>
